import React from "react";

const Footer = (props) => {
    const { company, email } = props;

    return (
        <div className='container-fluid'>
            <hr />
            <div className='text-center'>
                Powered By {company} | Contact By Email: {email}
            </div>

        </div>
    )
}

export default Footer;
